int main(void) {
	Solution solution;
	for (const auto &i : solution.findAnagrams("cbaebabacd", "abc")) cout << i << '\t';
	cout << "\tPassed\n";
	for (const auto &i : solution.findAnagrams("abab", "ab")) cout << i << '\t';
	cout << "\tPassed\n";
	for (const auto &i : solution.findAnagrams("", "")) cout << i << '\t';
	cout << "\tPassed\n";
	cout << "\nPassed All\n";
	return 0;
}